 public:
  void createb();
  void showb();
  void showlist();
  void assignbno(int x)       //bno assigned on the basis of no
  {          //no. of objects in file
   bno=10001;
   bno+=x-1;
   start1:
    bno+=1;
    if(res_book(bno,0))
    goto start1;
  }
  void set_q()
  {
   quant-=1;
  }
  int quantity()
  {
   return quant;
  }
  void reset_q()
  {
   quant+=1;
  }
  int retbno()
  {
   return bno;
  }
};
/*End of class book*/


